import { useEffect, useState } from 'react'
import styles from './App.module.scss';
import Layout from './LayOut';
// import { Link, Router } from 'react-router-dom'
import LayOutDataMenu from './DataMenu/LayOutDataMenu';
import Header from './LayOut/Header';
import MenuSneakers from './LayOut/menuSneaker/MenuSneakers';
import DetailSneaker from './LayOut/detailSneaker/DetailSneaker';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import Home from './LayOut/home/Home';
import { dataType } from './LayOut/Header';


const data = [
  {
    id: 1,
    path: '/',
    element: <Home />
  },
  {
    id: 2,
    path: '/detail',
    element: <DetailSneaker />
  },
  {
    id: 3,
    path: '/:type',
    element: <MenuSneakers />,
  },

]
function App() {
  return (

    <Router>
      <div className='App'>
        <Routes>
          <Route path='/' element={<Home />} />
          <Route path='/product/:code' element={<DetailSneaker />} />
          {
            dataType.map(
              item => {
                return <Route key={item.id} path={`/${type}`} element={<MenuSneakers typeOfProduct={item.type} />} /> 
              }
            )
          }
        </Routes>
      </div>
    </Router>
  );
}

export default App;
